import React from 'react';
import "../styles/EmployeeTable.css";

const Search = (props) => {

    return(
    
        <nav className="navbar">
            <form className="form-inline m-2">
                <input className="form-control" value={props.handleInputChange} type="search" placeholder="Search"
                />
                <button type="button" onSubmit={props.handleFormatSubmit} className="btn btn-primary">Search</button>
            </form>
        </nav>
    );
}

export default Search;
